const initialestate={
    user:'admin',
    pass:'1234'
}
const reducer=(state= initialestate,action)=>{
    switch(action.type){
        case "user":
            return{...state,user:action.payload}
            case "pass":
            return{...state,pass:action.payload}
        default:
            return state
    }
    
}
export default reducer
